import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { title: "Product 1", price: 10, description: "First Product", date: "20/04/1999" },
    { title: "Product 2", price: 20, description: "Second Product", date: "18/02/2000" },
  ];

  return (
    <div>
      <h2>Let's get started! Rohan</h2>
      <ExpenseItem title={expenses[0].title} price={expenses[0].price} description={expenses[0].description} date={expenses[0].date} />
      <ExpenseItem title={expenses[1].title} price={expenses[1].price} description={expenses[1].description} date={expenses[1].date} />
    </div>
  );
}

export default App;
